script:
const origin = { x: -5, z: -11 };
const size = { x: 8, y: 10, z: 8 };
reset();

const door = false;

box(
  origin.x - 1, 0, origin.z - 1,
  size.x + 4, size.y + 4, size.z + 4,
  3
);
box(
  origin.x, 1, origin.z,
  size.x + 2, size.y + 2, size.z + 2,
  door ? 3 : 1
);
box(
  origin.x + 1, 2, origin.z + 1,
  size.x, size.y, size.z,
  0
);
box(
  origin.x + 3, 2, origin.z + size.z + 1,
  4, 8, 2,
  0
);
if (door) {
  box(
    origin.x + 4, 2, origin.z + size.z + 1,
    2, 8, 1,
    1
  );
}
for (let i = 0; i < 2; i += 1) {
  update(
    Math.floor(origin.x + size.x * 0.5) - 2 + i * 5,
    size.y + 2,
    Math.floor(origin.z + size.z * 0.5) + 1,
    door ? 4 : 2
  );
}
